function onChange(n){HttpGet(`/ProposalPlotDetails/GetKhasraList/?villageId=${n}`,"json",function(n){for(var i='<option value="0">Select<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#KhasraId").select2("val","");$("#KhasraId").html(i)})}$("#KhasraId").change(function(){var n=$(this).val();n&&HttpGet(`/UnderSection4PlotForm/GetAreaList/?khasraid=${n}`,"json",function(n){$("#Bigha").val(n.bigha);$("#Biswa").val(n.biswa);$("#Biswanshi").val(n.biswanshi)})});